import React from 'react';
import Button from 'react-bootstrap/Button';
import Scroll from '../../Scroll/Scroll'
import './Holidays.css';

class Holidays extends React.Component{
	constructor(props){
		super(props);
		this.state = {
			rHolidayList: [

			],
			nrHolidayList: [



			]
		}
	}

	render(){
		return(
			<div className="body">
				<div className="left">

					<div className="top">
						<h4 className="subtitle">Recurring Holidays</h4>
						<Button variant="primary">Add Recurring Holiday</Button>
					</div>
					<Scroll>
						<br/>
						<ul className="">
							<li>
								New Year's Day        <input type="checkbox"/>
							</li>


							<li>MLK Day</li>
							<li>Christmas Day</li>


						</ul>
					</Scroll>











				</div>
				<div className="right">
					<div className="top">
						<h4 className="subtitle">Non-recurring Holidays</h4>
						<Button variant="primary">Add Non-recurring Holiday</Button>
					</div>
					<Scroll>
						<br/>
						<ul className="">
							<li>Party</li>
							<li>Easter</li>
							<li>Cycle 4 St. Joes</li>


						</ul>
					</Scroll>









				</div>
			</div>


		);



	}


}

export default Holidays;
